import React from 'react'
import { styles } from '../styles';



export const NavBar = (props) => {
    const year = props.date.getFullYear()


  return (
    <div style={styles.Container}>
        <text>{year}</text>
        <a>Home</a>
        <a>Resume</a>
        <a>Personal Interests</a>
        <div>
            <a>LinkedIn</a>
            <a>GitHub</a>
        </div>
    </div>

  );
};
